var day = DateTime.Now.DayOfWeek;
var hour = DateTime.Now.Hour;
var minute = DateTime.Now.Minute;
var saturday = 205200-hour*3600-minute*60;
var sunday = 118800-hour*3600-minute*60;
Set("Day", Convert.ToInt32(day));
Set("ToSunday", Convert.ToInt32(sunday));
Set("ToSaturday", Convert.ToInt32(saturday));
return true;
